import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
  const [count, setCount] = useState(0)

  const add = () => {
    setCount(count + 1)
  }

  const substract = () => {
    if (count > 0) {
      setCount(count - 1)
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        Counter result : {count}
        <div>
          <button style={{width: "100px", height:"40px"}} onClick={add}>+</button>
          <button style={{}} onClick={substract}>-</button>
        </div>
      </header>
    </div>
  );
}

export default App;
